function findValidPrime(numbers) {
  const isValid = (num) => {
    if (num <= 1) return false;
    if (num === 2) return true;

    for (let i = 2; i < num; i++) {
      if (num % i === 0) return false;
    }
    return true;
  };

  let hasPrime = false;
  for (let i = 0; i < numbers.length; i++) {
    if (isValid(numbers[i])) {
      console.log("Found a valid prime: " + numbers[i]);
      hasPrime = true;
      break;
    }
