In TypeScript, you can use explicit type annotations to indicate that certain values might have different types depending on their context or property names. To specify that an object's properties might have multiple types at runtime, you can use `Record` along with conditional type checks.

Here is an example:

```typescript
interface Person {
  name: string;
}

interface Employee extends Person {
  jobTitle: string;
}

const employee: Employee = { name: 'John Doe', jobTitle: 'Engineer' };

// In TypeScript, we cannot directly infer the exact type of the properties.
// However, if you know the structure of the objects, you can use record syntax:
const person: Record<string, unknown> = { name: 'John Doe', jobTitle: 'Engineer' };
```

In the above example, `person` is an object with two properties `name` and `jobTitle`. The `Record` type specifies the expected key for each property, even though TypeScript does not guarantee that the keys will always match the actual data structures. If you need more specific typing constraints (like instance-specific properties), you would typically use class decorators like `@type`, which helps TypeScript enforce those requirements during compilation.

