The `==` operator is used for comparing values of types that support identity comparison (such as primitives like integers or booleans). In Java, this includes basic data types like `int`, `boolean`, `char`, etc., but not objects.

Here's how you can use `=` for object comparisons:

- For primitive types:
  ```java
  int x = 10;
  int y = 10;

  if (x == y) {
      System.out.println("x and y have the same value.");
  }
  ```

- For class objects:
  ```java
  Person person1 = new Person();
  Person person2 = person1;

  System.out.println(person1.equals(person2)); // true

  person1.age = 30;
  person2.age = 30;

  System.out.println(person1.equals(person2)); // false

  ```
In these examples, `person1` and `person2` refer to the same instance of the `Person` class, so calling `equals()` will return false.

Now let's discuss why the `==` operator was problematic and what to avoid:

**Pros of using `==`:**
- Simple and straightforward way to check if two variables point to the same object.

**Cons of using `==`:**
- It does not work well when comparing objects because it compares their references rather than their contents.

**When to use `equals()`:**
Use `equals()` when you want to compare the content of two objects, such as different instances of a class or objects with different representations of the same data. The key idea here is that `equals()` considers the objects themselves, not just their contents.

**Example:**

```java
public class Person {
    private String name;

    public Person(String name) {
        this.name = name;
    }

    @Override
    public boolean equals(Object obj) {
        if (this == obj)
            return true;
        if (obj == null || getClass() != obj.getClass())
            return false;

        Person other = (Person) obj;

        return name.equals(other.name);
    }
}
```

In this example, we're checking whether the given `Person` object has the same `name` field by comparing its reference (`other.name`). This method works well because it checks the objects' contents directly, not their references.

