```python
class Stack:
    def __init__(self):
        self.stack = []

    def is_empty(self):
        return not bool(self.stack)

    def push(self, item):
        self.stack.append(item)

    def pop(self):
        if self.is_empty():
            raise Exception("Stack is empty")

        return self.stack.pop()

    def peek(self):
        if self.is_empty():
            raise Exception("Stack is empty")

        return self.stack[-1]


class Queue:
    def __init__(self):
        self.stacks = [Stack(), Stack()]

    def enqueue(self, item):
        top_stack = self.stacks[1].pop()

        if not self.stacks[0].is_empty():
            self.stacks[0].push(top_stack)

        self.stacks[1].push(item)

    def dequeue(self):
        if self.stacks[0].is_empty():
            while not self.stacks[1].is_empty():
                self.stacks[1].pop()

            if self.stacks[1].is_empty():
                return None

            return self.stacks[0].pop()

        return self.stacks[0].pop()


# Example usage:
q = Queue()

q.enqueue(1)
q.enqueue(2)
q.enqueue(3)

print(q.dequeue())  # Output: 1
print(q.dequeue())  # Output: 2
print(q.dequeue())  # Output: 3
print(q.dequeue())  # Output: 3 (but the stack is empty, so this won't work)
```

